SELECT
	st.student_id,
	st.student_activity_indicator as current_mps_activity,
	st.student_status as current_mps_status,
	stx.date1 as last_admit,
	stx.date3 as last_reg,
	stx.date2 as last_wd,
	st.student_special_ed_indicator,
	st.student_current_grade_code,
	st.student_current_school_code,
	st.student_current_school,
	st.student_next_year_school,
	st.student_next_year_school_code,
	to_char(sap.fall_school) as sap_next_year_school
FROM
	K12INTEL_DW.DTBL_STUDENTS st
	INNER JOIN K12INTEL_DW.DTBL_STUDENTS_EXTENSION stx on st.student_id = stx.student_id
	LEFT OUTER JOIN (K12INTEL_STAGING.MPS_SAP_STUDENT_PROFILE sap
				INNER JOIN K12INTEL_DW.DTBL_SCHOOL_ANNUAL_ATTRIBS schaa on to_char(sap.fall_school) = schaa.school_code
																			and schaa.school_year = '2013-2014'
																			and schaa.reporting_school_ind = 'Y')
				on st.student_id = to_char(sap.pupil_number)
